import React from "react";

function MostPicked() {
  return (
    <section className="container">
      <h4 className="mb-3">Most Picked</h4>
      <div className="container-grid">
        <div className="item column-4 row-2"></div>
      </div>
    </section>
  );
}

export default MostPicked;
